import React, { useState, useEffect } from 'react';

function TableForm({ formId, onDeleteTable, onDeleteForm, updateTableForm, availableTables }) {
  const [tableName, setTableName] = useState('');
  const [columns, setColumns] = useState([{ name: '', dataType: 'varchar' }]); // Default column
  const [foreignKeys, setForeignKeys] = useState([]);

  useEffect(() => {
    // Update the parent component with the current form data
    updateTableForm({ id: formId, tableName, columns, foreignKeys });
  }, [tableName, columns, foreignKeys]);

  const addColumn = () => {
    setColumns([...columns, { name: '', dataType: 'varchar' }]);
  };

  const updateColumn = (index, key, value) => {
    const newColumns = [...columns];
    newColumns[index][key] = value;
    setColumns(newColumns);
  };

  const removeColumn = (index) => {
    setColumns(columns.filter((_, i) => i !== index));
  };

  const addForeignKey = () => {
    setForeignKeys([...foreignKeys, { column: '', referencesTable: '', referencesColumn: '' }]);
  };

  const updateForeignKey = (index, key, value) => {
    const newForeignKeys = [...foreignKeys];
    newForeignKeys[index][key] = value;
    setForeignKeys(newForeignKeys);
  };

  const removeForeignKey = (index) => {
    setForeignKeys(foreignKeys.filter((_, i) => i !== index));
  };

  const handleDelete = () => {
    if (tableName) {
      console.log(`Attempting to delete table: ${tableName}`);
      onDeleteTable(tableName);
    }
    onDeleteForm(formId);
  };

  return (
    <div className="table-form">
      <input
        type="text"
        value={tableName}
        onChange={(e) => setTableName(e.target.value)}
        placeholder="Table Name"
        required
      />
      {columns.map((column, index) => (
        <div key={index} className="column-row">
          <input
            type="text"
            value={column.name}
            onChange={(e) => updateColumn(index, 'name', e.target.value)}
            placeholder="Column Name"
            required
          />
          <select
            value={column.dataType}
            onChange={(e) => updateColumn(index, 'dataType', e.target.value)}
          >
            <option value="varchar">VARCHAR</option>
            <option value="integer">INTEGER</option>
            <option value="date">DATE</option>
          </select>
          <button onClick={() => removeColumn(index)}>Remove</button>
        </div>
      ))}
      <button onClick={addColumn}>Add Column</button>

      <h3>Foreign Keys</h3>
      {foreignKeys.map((fk, index) => (
        <div key={index} className="foreign-key-row">
          <select
            value={fk.column}
            onChange={(e) => updateForeignKey(index, 'column', e.target.value)}
          >
            <option value="">Select Column</option>
            {columns.map((col, colIndex) => (
              <option key={colIndex} value={col.name}>{col.name}</option>
            ))}
          </select>
          <select
            value={fk.referencesTable}
            onChange={(e) => updateForeignKey(index, 'referencesTable', e.target.value)}
          >
            <option value="">References Table</option>
            {availableTables.map((table, tableIndex) => (
              <option key={tableIndex} value={table.name}>{table.name}</option>
            ))}
          </select>
          <input
            type="text"
            value={fk.referencesColumn}
            onChange={(e) => updateForeignKey(index, 'referencesColumn', e.target.value)}
            placeholder="References Column"
            required
          />
          <button onClick={() => removeForeignKey(index)}>Remove</button>
        </div>
      ))}
      <button onClick={addForeignKey}>Add Foreign Key</button>
      <button onClick={handleDelete}>Delete Table</button>
    </div>
  );
}

export default TableForm;
